import React from 'react';
import './App.css';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import HomeIcon from '@material-ui/icons/Home';
import FormatListNumberedIcon from '@material-ui/icons/FormatListNumbered';
import FavoriteIcon from '@material-ui/icons/Favorite';
import FitnessCenterIcon from '@material-ui/icons/FitnessCenter';
import LocationOnIcon from '@material-ui/icons/LocationOn';
import PersonIcon from '@material-ui/icons/Person';

function App() {

  const [value, setValue] = React.useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className="App">
      <p>fk vet enzo</p>
      <footer>
      <BottomNavigation value={value} onChange={handleChange} className='bottomnav'>
        <BottomNavigationAction label="Home" value="home" icon={<HomeIcon />} />
        <BottomNavigationAction label="Valeus" value="fitnesscenter" icon={<FormatListNumberedIcon />} />
        <BottomNavigationAction label="Nearby" value="nearby" icon={<HomeIcon />} />
        <BottomNavigationAction label="Folder" value="folder" icon={<HomeIcon />} />
      </BottomNavigation>
      </footer>
    </div>
  );
}

export default App;
